import React from "react";
import "..Css/ProjectsSection.";
import project01 from "../assets/project01.jpg";
import project02 from "../assets/project01.jpg"; // add your second image

const ProjectsSection = () => {
  const projects = [
    {
      id: 1,
      name: "Project name 01",
      role: "Role Title",
      description:
        "I'm a paragraph. Click here to add your own text and edit me. It’s easy. Just click “Edit Text” or double click me...",
      image: project01,
    },
    {
      id: 2,
      name: "Project name 02",
      role: "Role Title",
      description:
        "This is another sample description for a second project. You can change this content freely.",
      image: project02,
    },
  ];

  return (
    <section className="projects-wrapper" id="projects">
      <div className="projects-heading">
        <span className="blue-square" />
        <h2>Projects</h2>
      </div>

      <p className="projects-intro">
        I'm a paragraph. Click here to add your own text and edit me. It’s easy. Just click “Edit Text” or double click me to add your
        own content and make changes to the font. I’m a great place for you to tell a story and let your users know a little more about
        you.
      </p>

      {projects.map((project) => (
        <article className="project-card" key={project.id}>
          <div className="project-card-left">
            <span className="accent-bar" />
            <div className="project-content">
              <h3 className="project-name">{project.name}</h3>
              <p className="role-title">{project.role}</p>
              <p className="project-desc">{project.description}</p>
            </div>
          </div>

          <div className="project-card-right">
            <img src={project.image} alt={project.name} />
          </div>
        </article>
      ))}
    </section>
  );
};

export default ProjectsSection;
